const mongoose = require("mongoose");

const blogSchema = new mongoose.Schema({
  
  image: {
    type: String,
    required: false,
    default: "data:image/jpg;base64,"
  },

  title: {
    type: String,
    required: true,
  },

  content: {
    type: String,
    required: true,
  },
});

const Blog = mongoose.model('Blog', blogSchema);

module.exports = Blog;